import java.util.Scanner; public class Game01 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        int testCase = scanner.nextInt();        while (testCase-- != 0) {            String str = scanner.next();            System.out.println(solve(str));        }    }     public static String solve(String str) {        int count = 0;        int helper = 0;        for (int i = 0; i < str.length(); i++) {            if (str.charAt(i) == '0') {                count++;            } else                helper++;        }        int num = Math.min(count, helper);        return num %2 == 1 ? "DA" : "NET";    }}
